script: |
  super -f text -I q7559.spq | sort > q7559.out

inputs:
  - name: q7559.spq
    data: |
      SELECT ( - col1 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 NOT BETWEEN ( - - CAST ( 14 AS INTEGER ) ) AND 62 AND NOT col0 <> ( + col2 );
  - name: tab2

outputs:
  - name: q7559.out
    data: |
